import styled from 'styled-components';

export const Container = styled.div`
    height:50px;
    background-color:#000000;
    color: #FFFAFA;
    display: flex;
    justify-content: center;
    align-items: center;
    font-size: 18px;

    .link {
        text-decoration: none;
        margin-right: 10px;
        color: #FFFAFA;
    }
`;
